

# temp table

# THIS_QUERY_WILL_LEAD_MOLOCO_TO_UNICORN_DO_NOT_KILL
CREATE OR REPLACE TABLE `focal-elf-631.sangeun.oliveyoung_imp_2024` AS (
SELECT
    DATE_TRUNC(DATE(req.timestamp), MONTH) AS month, 
    req.exchange AS exchange, 
    req.bid_region AS bid_region, 
    api.creative.id AS creative_id, 
    api.creative.title AS creative_title, 
    api.campaign.id AS campaign_id
FROM
    `moloco-dsp-data-view.prod_stream.imp`
WHERE
    DATE(timestamp) BETWEEN '2024-01-01' AND '2024-12-31'
    AND api.campaign.id in ('u9XS8sbheOOII7KR', 'aq9tV1lR3FfDyVjy', 'nJ4K4F62HARMYl1K', 'gumr847XbrirZO3G')
)

# raw data

WITH exchange_region AS (
SELECT
    month,
    exchange,
    creative_id,
    campaign_id,
    SUM(CASE WHEN bid_region = 'US' THEN 1 ELSE 0 END) AS count_us,
    SUM(CASE WHEN bid_region = 'ASIA' THEN 1 ELSE 0 END) AS count_asia
FROM
`focal-elf-631.sangeun.oliveyoung_imp_2024`
WHERE
creative_id IN ('DmgW41cNPz0rIdRK', 'MKLh2K7F8zFy33QR', 'ZF8avnLOabUS50iz','xrmzmSLz6RNXdVLi','nTidM1jL4jy3Yxux','RPFZyn3AyE63UOmZ','k2eHyENgFQTYdGSc')
GROUP BY 1, 2, 3, 4
) 
SELECT
    month, 
    exchange, 
    creative_id, 
    campaign_id, 
    count_us, 
    count_asia,
    (count_us / (count_us + (count_asia + count_asia)) * 100) AS percentage_of_us
FROM exchange_region 
GROUP BY ALL;


