/* Generalized Query */

DECLARE run_to_date DATE DEFAULT "2025-01-10";


    WITH
    product AS (
      SELECT
        DISTINCT
          JSON_VALUE(original_json, "$.advertiser_name") AS advertiser_id,
      FROM
        `focal-elf-631.standard_digest.latest_digest` a 
        INNER JOIN 'moloco-ods.haewon.multi_iab_impacted_app_bundle_all' b
            ON a.id = b.product_id
      WHERE
        type = 'PRODUCT'
        AND JSON_VALUE(original_json, "$.type") = 'APP'
        AND b.fact_dsp_core_gross_spend_usd_l7d > 0
    ),

    advertiser AS (
      SELECT
        *,
        COALESCE(DATE_SUB(LAG(effective_date_local) OVER(PARTITION BY platform_id, advertiser_id ORDER BY effective_date_local DESC), INTERVAL 1 DAY), run_to_date) AS last_effective_date_local,
      FROM
      (
        SELECT
          DISTINCT
            a.effective_date_local,
            a.platform.id AS platform_id,
            a.advertiser.id AS advertiser_id,
            a.advertiser.timezone AS advertiser_timezone,
            a.platform.serving_cost_percent AS platform_serving_cost_percent,
            a.platform.contract_markup_percent AS platform_markup_percent
        FROM
          `moloco-dsp-data-source.costbook.costbook` a INNER JOIN product b 
            ON a.advertiser.id = b.advertiser_id
        WHERE 1=1          
        AND
          DATE_DIFF(run_to_date, effective_date_local, DAY) >=0
      )
    ),

    advertiser_timezone AS (
      SELECT
        DISTINCT
        platform_id,
        advertiser_id,
        advertiser_timezone
      FROM
        advertiser
    ),

    imp_t AS (
      SELECT
        I.advertiser_id,
        I.api.product.id AS product_id,
        I.req.app.bundle AS publisher,
        DATE(I.timestamp, A.advertiser_timezone) AS local_date,
        A.platform_serving_cost_percent,
        A.platform_markup_percent,
        SUM(I.imp.win_price_usd.amount_micro / 1e6) AS win_price_usd,
        COUNT(*) AS imp,
      FROM
        `focal-elf-631.prod_stream_view.imp` AS I
      INNER JOIN
        advertiser AS A
        ON I.platform_id=A.platform_id
            AND I.advertiser_id=A.advertiser_id
            AND A.effective_date_local<=DATE(I.timestamp, A.advertiser_timezone)
            AND DATE(I.timestamp, A.advertiser_timezone)<=A.last_effective_date_local
      INNER JOIN 
          `moloco-ods.haewon.multi_iab_impacted_app_bundle_all` app
            ON I.api.product.id = app.product_id
      WHERE
        DATE(I.timestamp) BETWEEN DATE_SUB(run_to_date, INTERVAL 6 DAY) AND run_to_date
        AND app.fact_dsp_core_gross_spend_usd_l7d > 0
      GROUP BY ALL
    )

    SELECT
      I.advertiser_id,
      I.product_id,      -- I.local_date,
      CASE WHEN bpub.bpub IS NULL then 'Not blocked' ELSE 'Blocked' END AS is_blocked,
      SAFE_CAST(SUM(I.win_price_usd * (1 + I.platform_serving_cost_percent/100) * (1 + I.platform_markup_percent/100)) AS FLOAT64) AS gross_spending_usd,
      SUM(I.imp) AS imp,
    FROM
      imp_t AS I LEFT JOIN `moloco-ods.haewon.multi_iab_bcat_blocked_pub_by_product_1201_1211` bpub
        ON I.product_id = bpub.product_id
        AND I.publisher = bpub.bpub
    GROUP BY ALL